function formatField(value) {
    return value && value.trim() !== "" && value !== "undefined" ? value : null;
}

// Cria uma lista formatada com limite de itens
function formatList(items, limit) {
    return items.slice(0, limit).map(item => `- ${item}`).join('\n');
}

