function formatarTelefones(dados) {
    if (!dados.DATA || !dados.DATA.TELEFONES || !Array.isArray(dados.DATA.TELEFONES)) {
        return "Nenhum telefone encontrado.";
    }

    const telefones = dados.DATA.TELEFONES;
    const telefonesSet = new Set();

    // Adiciona os telefones √∫nicos no Set
    telefones.forEach(tel => {
        if (tel.TELEFONE && tel.TELEFONE.trim() !== '' && tel.TELEFONE !== '55') {
            telefonesSet.add(tel.TELEFONE);
        }
    });

    if (telefonesSet.size === 0) {
        return "Nenhum telefone v√°lido encontrado.";
    }

    // Formata o resultado com no m√°ximo 3 telefones
    let resultado = "## *Telefones:*\n";
    Array.from(telefonesSet).slice(0, 3).forEach(telefone => {
        resultado += ` - _${telefone}_\n`;
    });

    return resultado;
}

